import axios from 'axios';

const API_URL = 'http://localhost:3001/users/login';

const signUpService = {
  getUserById: (userId) => {
    return axios.get(`${API_URL}/${userId}`).then((response) => response.data);
  },

  createUser: (userData) => {
    console.log(userData);
    const mappedData = { ...userData };

    return axios.post(API_URL, mappedData).then((response) => response.data);
  },

  login: async (userData) => {
    try {
        console.log(`${API_URL}/signup`, userData);
      const response = await axios.post(`${API_URL}/singup`, userData);
      return response.data;
    } catch (error) {
      throw error;
    }
  },
};

export default signUpService;
